rect the form below and try again.'=>'Ada suatu masalah, silakan periksa formulir berikut ini dan coba lagi.','Get <em>another</em> %s site in seconds'=>'Dapatkan Situs <em>lain</em> %s dalam hitungan detik','Your registration email is sent to this address. (Double-check your email address before continuing.)'=>'E-mail pendaftaran Anda dikirim ke alamat ini. (Periksa kembali alamat e-mail Anda sebelum melanjutkan).','Email&nbsp;Address:'=>'Alamat&nbsp;Email:','(Must be at least 4 characters, lowercase letters and numbers only.)'=>'(Minimal harus 4 karakter, huruf kecil dan angka saja.)','No'=>'Tidak','Yes'=>'Ya','Allow search engines to index this site.'=>'Ijinkan mesin pencari untuk mengindeks situs ini.','Privacy:'=>'Privasi:','Site Language:'=>'Bahasa Situs:','Site Title:'=>'Judul Situs:','Must be at least 4 characters, letters and numbers only. It cannot be changed, so choose carefully!'=>'Minimal harus 4 karakter, huruf dan angka saja. Ini tidak dapat diubah, jadi pilihlah dengan hati-hati!','Your address will be %s.'=>'Alamat Anda akan menjadi %s.','domain'=>'domain','sitename'=>'namasitus','Site Domain (subdomain only):'=>'Domain Situs (hanya subdomain):','Site Name (subdirectory only):'=>'Nama Situs (hanya subdirektori):','Mission complete. Message %s deleted.'=>'Misi selesai. Pesan %s terhapus.','Oops: %s'=>'Ups: %s','Posted title:'=>'Judul artikel:','Author:'=>'Penulis:','There does not seem to be any new mail.'=>'Kelihatannya tak ada e-mail baru.','Slow down cowboy, no need to check for new mails so often!'=>'Pelan-pelan Bung, tak perlu memeriksa pesan baru terlalu sering!','This action has been disabled by the administrator.'=>'Tindakan ini telah dinonaktifkan oleh administrator.','Show password'=>'Tampilkan sandi','Recovery Mode Initialized. Please log in to continue.'=>'Mode Pemulihan telah dimulai. Silakan login untuk melanjutkan.','<strong>You have successfully updated WordPress!</strong> Please log back in to see what&#8217;s new.'=>'<strong>Anda berhasil memperbarui WordPress!</strong> Silakan masuk kembali untuk melihat apa saja yang baru.','<strong>Error:</strong> User registration is currently not allowed.'=>'<strong>Eror</strong>: Pendaftaran pengguna saat ini tidak diizinkan.','You are now logged out.'=>'Anda telah log keluar.','Your session has expired. Please log in to continue where you left off.'=>'Sesi Anda telah berakhir. Silakan masuk untuk melanjutkan sesi sebelumnya.','You have logged in successfully.'=>'Anda berhasil log masuk.','https://wordpress.org/documentation/article/cookies/#enable-cookies-in-your-browser'=>'https://wordpress.org/documentation/article/cookies/#enable-cookies-in-your-browser','<strong>Error:</strong> Cookies are blocked or not supported by your browser. You must <a href="%s">enable cookies</a> to use WordPress.'=>'<strong>Eror</strong>: Kuki diblok atau tak didukung oleh browser Anda. Anda harus <a href="%s">mengaktifkan kuki</a> untuk menggunakan WordPress.','https://wordpress.org/documentation/article/cookies/'=>'https://wordpress.org/documentation/article/cookies/','<strong>Error:</strong> Cookies are blocked due to unexpected output. For help, please see <a href="%1$s">this documentation</a> or try the <a href="%2$s">support forums</a>.'=>'<strong>Eror</strong>: Kuki diblok akibat kendala yang tak terduga. Untuk mendapatkan bantuan, silakan baca <a href="%1$s">dokumentasi berikut</a> atau kunjungi <a href="%2$s">forum bantuan</a>.','User action confirmed.'=>'Tindakan pengguna terkonfirmasi.','Missing confirm key.'=>'Kunci konfirmasi tidak ada.','Missing request ID.'=>'ID permohonan tidak ada.','Check your email'=>'Periksa e-mail Anda','Registration complete. Please check your email, then visit the <a href="%s">login page</a>.'=>'Pendaftaran selesai. Silakan periksa e-mail Anda, kemudian kunjungi <a href="%s">laman login</a>.','Check your email for the confirmation link, then visit the <a href="%s">login page</a>.'=>'Periksa e-mail Anda untuk tautan konfirmasi, lalu ku