leh berbeda dari alamat email pribadi Anda.','Current administration email: %s'=>'Email administrasi saat ini: %s','Why is this important?'=>'Mengapa ini penting?','https://wordpress.org/documentation/article/settings-general-screen/#email-address'=>'https://wordpress.org/documentation/article/settings-general-screen/#email-address','Please verify that the <strong>administration email</strong> for this website is still correct.'=>'Harap verifikasi bahwa <strong>email administrasi</strong> untuk situs web ini benar.','Administration email verification'=>'Verifikasi email administrasi','Confirm your administration email'=>'Konfirmasikan email administrasi Anda','Change'=>'Ubah','site&larr; Go to %s'=>'&larr; Pergi ke %s','Powered by WordPress'=>'Dipersembahkan oleh WordPress','Usage of the title attribute on the login logo is not recommended for accessibility reasons. Use the link text instead.'=>'Penggunaan atribut judul pada logo login tidak direkomendasikan karena alasan aksesibilitas. Gunakan teks link sebagai gantinya.','Recovery Mode &#8212; %s'=>'Mode Pemulihan &#8212; %s','%1$s &lsaquo; %2$s &#8212; WordPress'=>'%1$s &lsaquo; %2$s &#8212; WordPress','Create a Configuration File'=>'Buat Berkas Konfigurasi','You can create a %s file through a web interface, but this doesn\'t work for all server setups. The safest way is to manually create the file.'=>'Anda dapat membuat sebuah berkas %s melalui antar-muka web, namun ini belum tentu berfungsi untuk semua jenis pengaturan server. Cara paling aman adalah dengan membuatnya secara manual.','https://wordpress.org/documentation/article/editing-wp-config-php/'=>'https://wordpress.org/documentation/article/editing-wp-config-php/','Need more help? <a href="%1$s">Read the support article on %2$s</a>.'=>'butuh lebih banyak bantuan? <a href="%1$s">Baca artikel dukungan di %2$s</a>.','There doesn\'t seem to be a %s file. It is needed before the installation can continue.'=>'Sepertinya tidak ada berkas %s. Ini diperlukan sebelum instalasi dapat dilanjutkan.','Links for %s'=>'Taut untuk %s','Hey there, looks like you just pasted HTML into the &#8220;Visual&#8221; tab of the Text widget. You may want to paste your code into the &#8220;Text&#8221; tab instead. Alternately, try out the new &#8220;Custom HTML&#8221; widget!'=>'Hai, sepertinya Anda baru saja menempelkan kode HTML ke dalam tab &#8220;Visual&#8221; dalam Widget teks. Anda mungkin ingin menempelnya pada tab &#8220;Text&#8221; sebenarnya. Jika tidak, cobalah widget &#8220;HTML Khusus&#8221; yang baru!','Did you just paste HTML?'=>'Apakah Anda baru saja menempelkan HTML?','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by scanning the list of available widgets on this screen. Check it out to add some custom code to your site!'=>'Tahukan Anda bahwa kami punya sebuah widget &#8220;HTML Kustom&#8221; sekarang? Anda bisa menemukannya dengan memperhatikan daftar widget yang tersedia di laman ini. Cobalah untuk menambahkan beberapa kode kustom ke situs Anda!','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by pressing the &#8220;<a class="add-widget" href="#">Add a Widget</a>&#8221; button and searching for &#8220;HTML&#8221;. Check it out to add some custom code to your site!'=>'Tahukan Anda bahwa kami punya sebuah widget &#8220;HTML Kustom&#8221; sekarang? Anda bisa menemukannya dengan menekan tombol &#8220;<a class="add-widget" href="#">Tambahkan Widget</a>&#8221; dan carilah &#8220;HTML&#8221;. Cobalah untuk menambahkan beberapa kode kustom ke situs Anda!','New Custom HTML Widget'=>'Widget HTML Khusus Baru','Automatically add paragraphs'=>'Secara otomatis menambahkan paragraf','This widget may have contained code that may work better in the &#8220;Custom HTML&#8221; widget. If you have not yet, how about trying that widget instead?'=>'Widget berikut mungkin mengandung kode yang akan bekerja lebih baik di widget &#8220;HTML Khusus&#8221;. Jika belum mencobanya, kenapa tida