ak menampilkannya.','Your theme has 1 other widget area, but this particular page does not display it.'=>'Tema Anda memiliki 1 area widget lainnya, namun laman ini tidak menampilkannya.','Move widgetMove'=>'Geser','Select an area to move this widget into:'=>'Pilih satu area untuk menempatkan widget ini:','Move to another area&hellip;'=>'Pindah ke area lain&hellip;','Widgets are independent sections of content that can be placed into widgetized areas provided by your theme (commonly called sidebars).'=>'Widget adalah bagian-bagian independen dari konten yang bisa ditempatkan di dalam area-area widget yang disediakan oleh tema Anda (umumnya dinamakan bilah sisi).','Press return or enter to open this section'=>'Tekan return atau enter untuk membuka bagian ini','Customizing'=>'Kustomisasi','Help'=>'Bantuan','You are customizing %s'=>'Anda sedang menyesuaikan %s','Press return or enter to open this panel'=>'Klik return atau enter untuk membuka panel ini','Add to Menu'=>'Tambahkan ke Menu','Link Text'=>'Teks Tautan','URL'=>'URL','Toggle section: Custom Links'=>'Buka seksi: Tautan Tersuai','Custom Links'=>'Taut Tersuai','Toggle section: %s'=>'Ubah bagian: %s','No items'=>'Tidak ada item','Clear Results'=>'Bersihkan Hasil Pencarian','The search results will be updated as you type.'=>'Hasil pencarian akan diperbarui saat Anda mengetik.','Search menu items&hellip;'=>'Item menu pencarian&hellip;','Search Menu Items'=>'Item-item Menu Pencarian','Add Menu Items'=>'Tambahkan Item Menu','Back'=>'Kembali','Create New Menu'=>'Buat Menu Baru','You&#8217;ll create a menu, assign it a location, and add menu items like links to pages and categories. If your theme has multiple menu areas, you might need to create more than one.'=>'Anda akan membuat sebuah menu, menentukan lokasinya, dan menambahkan anak menu seperti tautan ke beberapa laman atau kategori. Jika tema Anda memiliki beberapa area menu, mungkin Anda perlu membuat lebih dari satu lokasi menu.','It does not look like your site has any menus yet. Want to build one? Click the button to start.'=>'Sepertinya situs web Anda belum memiliki menu satu pun. Ingin membuat menu? Klik tombol untuk memulai.','Next'=>'Berikut','Click &#8220;Next&#8221; to start adding links to your new menu.'=>'Klik &#8220;Selanjutnya&#8221; untuk mulai menambahkan tautan pada menu baru Anda.','Delete Menu'=>'Hapus Menu','Move one level down'=>'Turunkan satu tingkat','Move one level up'=>'Naikkan satu tingkat','Move down'=>'Pindahkan ke bawah','Move up'=>'Pindahkan ke atas','Add to menu: %1$s (%2$s)'=>'Tambahkan ke menu: %1$s (%2$s)','%1$s could not be created: %2$s'=>'%1$s tidak bisa disimpan: %2$s','Post'=>'Pos','Status is forbidden.'=>'Status ini terlarang.','Empty title.'=>'Judul kosong.','Invalid post type.'=>'Tipe pos tidak sah.','New Menu'=>'Menu Baru','menu locationsView All Locations'=>'Lihat Semua Lokasi','menu locationsView Location'=>'Lihat Lokasi','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Jika tema Anda mempunyai area widget, Anda bisa juga menambah menu di sana. Kunjungi <a href="%s">panel Widget</a> dan tambahkan &#8220;widget Menu Navigasi&#8221; untuk menampilkan menu pada bilah sisi atau kaki.','Your theme can display menus in %s location. Select which menu you would like to use.'=>'Tema Anda bisa menampilkan menu di %s lokasi. Pilih menu yang ingin Anda gunakan.' . "\0" . 'Tema Anda bisa menampilkan menu di %s lokasi. Pilih menu yang ingin Anda tampilkan di masing-masing lokasi.','Your theme can display menus in one location. Select which menu you would like to use.'=>'Tema Anda dapat menampilkan beberapa menu dalam satu lokasi. Pilih menu mana yang ingin Anda gunakan.','Menus can be displayed in locations defined by your theme.'=>'Menu dapat ditampilkan di lokasi yang ditentukan oleh tema Anda.','Menus can be displayed in locations defined by your theme or in <a href="%s">widget areas</a> by adding a &#8220;Navigation Menu&#8221; widget.'=>'Menu-menu bisa ditampilkan di lokasi yang ditentukan oleh tema atau di <a href="%s">area widget</a> Anda dengan menambahkan widget &#8220;Menu Navigasi&#8221;.','This panel is used for managing navigation menus for content you have already published on your site. You can create menus and add items for existing content such as pages, posts, categories, tags, formats, or custom links.'=>'Panel ini digunakan untuk mengelola menu navigasi untuk konten yang sudah Anda terbitkan. Anda bisa membuat menu-menu dan menambahkan item-item untuk konten yang sudah ada, seperti laman, pos, kategori, tag, format, atau tautan tersuai.','%1$s. Sub item number %2$d under %3$s.'=>'%1$s. Sub item ke-%2$d di bawah %3$s.','%1$s. Menu item %2$d of %3$d.'=>'%1$s. Item menu ke-%2$d dari %3$d.','Out from under %s'=>'Keluarkan dari bawah %s','Under %s'=>'Di bawah %s','Move out from under %s'=>'Pindahkan dari bawah %s','Move under %s'=>'Pindahkan ke bawah %s','Move to the top'=>'Naikkan ke paling atas','Move down one'=>'Turunkan satu','Move up one'=>'Naikkan satu','Close reorder mode'=>'Tutup mode penyusunan ulang','Reorder menu items'=>'Susun ulang item menu','Reorder mode closed'=>'Mode pengaturan urutan ditutup','Reorder mode enabled'=>'Mode penyusunan ulang diaktifkan','Loading more results... please wait.'=>'Memuat lebih banyak hasil... mohon tunggu.','Additional items found: %d'=>'Item tambahan yang ditemukan: %d','Number of items found: %d'=>'Jumlah item yang ditemukan: %d','%s (Pending)'=>'%s (Menunggu)','%s (Invalid)'=>'%s (Tidak sah)','Customizing &#9656; %s'=>'Menyesuaikan &#9656; %s','Menu item is now a sub-item'=>'Item menu menjadi sub-item','Menu item moved out of submenu'=>'Item menu dikeluarkan dari submenu','Menu item moved down'=>'Item menu digeser ke bawah','Menu item moved up'=>'Item menu dinaikkan','Menu deleted'=>'Menu terhapus','Menu created'=>'Menu berhasil dibuat','Menu item deleted'=>'Item menu dihapus','Menu item added'=>'Item menu ditambahkan','If your theme has multiple menus, giving them clear names will help you manage them.'=>'Jika tema Anda memiliki banyak menu, pemberian nama yang jelas akan menolong Anda ketika menatanya.','Menu Name'=>'Nama Menu','Menu Locations'=>'Lokasi Menu','Menu Location'=>'Lokasi Menu','menu(Currently set to: %s)'=>'(Saat ini diatur ke: %s)','Missing menu name.(unnamed)'=>'(tanpa nama)','missing menu item navigation label(no label)'=>'(tanpa label)','Your theme can display menus in %s location.'=>'Tema Anda bisa menampilkan menu di %s lokasi.' . "\0" . 'Tema Anda bisa menampilkan menu di %s lokasi.','Your theme can display menus in one location.'=>'Tema Anda bisa menampilkan menu di satu lokasi.','No results found.'=>'Tak ditemukan hasil apapun.','Post Type Archive'=>'Arsip Tipe Pos','Custom Link'=>'Tautan Tersuai','nav menu home labelHome'=>'Beranda','Please enter a valid YouTube URL.'=>'Silakan masukkan URL YouTube yang sah.','Only %1$s or %2$s files may be used for header video. Please convert your video file and try again, or, upload your video to YouTube and link it with the option below.'=>'Hanya berkas %1$s atau %2$s yang bisa dipakai sebagai video tajuk. Silakan ubah berkas video Anda dan coba lagi, atau, unggah video Anda ke YouTube dan tautkan dengan pilihan di bawah ini.','This video file is too large to use as a header video. Try a shorter video or optimize the compression settings and re-upload a file that is less than 8MB. Or, upload your video to YouTube and link it with the option below.'=>'Berkas video ini terlalu besar untuk dipakai sebagai video tajuk. Cobalah video yang lebih pendek atau optimalkan pengaturan kompresi dan unggah ulang video berukuran di bawah 8MB. Atau, unggah video Anda ke YouTube dan tautkan dengan pilihan di bawah ini.','Unrecognized background setting.'=>'Pengaturan latar belakang tak dikenal.','Invalid value for background size.'=>'Nilai untuk ukuran latar