 need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'Anda bisa memilih apa yang ditampilkan di beranda situs Anda. Hal itu bisa diposkan dengan urutan kronologi terbalik (blog klasik), atau laman tetap. Untuk mengeset beranda tetap, Anda harus membuat dua laman. Satu sebagai beranda, dan lainnya untuk menempatkan pos yang Anda tampilkan.','Homepage Settings'=>'Pengaturan Beranda','Scroll with Page'=>'Bergulir bersama Laman','Repeat Background Image'=>'Gambar Latar Berulang','Original SizeOriginal'=>'Asli','Image Size'=>'Ukuran Gambar','Image Position'=>'Posisi Gambar','Custom PresetCustom'=>'Tersuai','Repeat ImageRepeat'=>'Berulang','Fit to Screen'=>'Sesuaikan dengan Layar','Fill Screen'=>'Penuhi Layar','Default PresetDefault'=>'Bawaan','Background PresetPreset'=>'Preset','Background Image'=>'Gambar Latar belakang','Or, enter a YouTube URL:'=>'Atau, masukkan URL YouTube:','Header Video'=>'Video Tajuk','Header Image'=>'Gambar Tajuk','Upload your video in %1$s format and minimize its file size for best results. Your theme recommends a height of %2$s pixels.'=>'Unggah video Anda dalam format %1$s dan perkecil ukuran berkasnya untuk hasil terbaik. Tema Anda menyarankan tinggi video %2$s piksel.','Upload your video in %1$s format and minimize its file size for best results. Your theme recommends a width of %2$s pixels.'=>'Unggah video Anda dalam format %1$s dan minimalkan ukurannya untuk hasil terbaik. Tema Anda menyarankan lebar video %2$s piksel.','Upload your video in %1$s format and minimize its file size for best results. Your theme recommends dimensions of %2$s pixels.'=>'Unggah video Anda dalam format %1$s dan minimalkan ukurannya untuk hasil terbaik. Tema Anda menyarankan dimensi %2$s piksel.','If you add a video, the image will be used as a fallback while the video loads.'=>'Jika Anda menambahkan video, gambar tersebut akan ditampilkan sementara video dimuat.','Header Media'=>'Media Tajuk','Background Color'=>'Warna Latar belakang','Header Text Color'=>'Warna Teks Tajuk','Colors'=>'Warna','Choose logo'=>'Memilih logo','No logo selected'=>'Tidak ada logo terpilih','Default'=>'Standar','Remove'=>'Singkirkan','Change logo'=>'Ganti logo','Select logo'=>'Pilih logo','Logo'=>'Logo','Site Icons should be square and at least %s pixels.'=>'Ikon situs harus persegi dan setidaknya berukuran %s piksel.','Site Icons are what you see in browser tabs, bookmark bars, and within the WordPress mobile apps. Upload one here!'=>'Ikon situs adalah apa yang Anda lihat di tab browser, bilah bookmark, dan ketika menggunakan aplikasi WordPress mobil. Unggahlah disini!','Site Icon'=>'Ikon Situs','Display Site Title and Tagline'=>'Tampilkan Judul Situs dan Slogan','Tagline'=>'Slogan','Site Title'=>'Judul Situs','Site Identity'=>'Identitas Situs','WordPress.org themes'=>'Tema WordPress.org','Installed themes'=>'Tema terpasang','While previewing a new theme, you can continue to tailor things like widgets and menus, and explore theme-specific options.'=>'Sambil meninjau tema baru, Anda dapat terus menyesuaikan beberapa hal seperti widget dan menu, serta menjelajahi pilihan-pilihan khusus pada tema.','Looking for a theme? You can search or browse the WordPress.org theme directory, install and preview themes, then activate them right here.'=>'Sedang mencari sebuah tema? Anda dapat mencari atau menjelajahi direktori tema WordPress.org, memasang dan meninjau tema-tema, lalu mengaktifkannya di sini.','Enter mobile preview mode'=>'Masuki mode pratinjau seluler','Enter tablet preview mode'=>'Masuki mode pratinjau tablet','Enter desktop preview mode'=>'Masuki mode pratinjau desktop','Showing details for theme: %s'=>'Menampilkan rincian untuk tema: %s','Displaying %d themes'=>'Menampilkan %d tema','%d themes found'=>'%d tema ditemukan','Are you sure you want to delete this theme?'=>'Apakah Anda yakin ingin menghapus tema ini?','customizer changeset action/button labelSchedule'=>'Jadwalkan','Save 